query RegionReadQuery($resource: RegionInput!, $withHistory: Boolean) {
  sports_region_read(resource: $resource, with_history: $withHistory) {
    item {
      resource {
        account
        key
        hashkey: _hashkey
        __typename
      }
      region {
        code
        short_code
        name
        kind
        country
        state
        official_name
        internal_name
        __typename
      }
      status {
        published
        notes
        __typename
      }
      __typename
    }
    history {
      cs {
        records {
          raw
          ts
          action
          att_stage
          authors {
            key
            name
            ts
            email
            picture_key
            ip
            __typename
          }
          __typename
        }
        cs_name
        version_key_meta {
          resource_id
          resource_key
          cs_name
          __typename
        }
        draft {
          raw
          ts
          action
          att_stage
          authors {
            key
            name
            ts
            email
            picture_key
            ip
            __typename
          }
          __typename
        }
        ready_to_publish {
          raw
          ts
          action
          att_stage
          authors {
            key
            name
            ts
            email
            picture_key
            ip
            __typename
          }
          __typename
        }
        next_page_key
        __typename
      }
      __typename
    }
    __typename
  }
}
